import './App.scss';

function App() {
	return (
		<div className='App'>
			<h2>Ultimate CSS Grid Course</h2>
			<p>This is the template you can use to follow along the course.</p>
			<div className='grid'>
				<div>Item 1</div>
				<div>Item 2</div>
				<div>Item 3</div>
				<div>Item 4</div>
				<div>Item 5</div>
				<div>Item 6</div>
			</div>
		</div>
	);
}

export default App;
